import Navbar from "./Navbar";
import Home from "./Home";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      {/* Router gives access to all nested components inside App function */}
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            {/* Switch ensures that at any time only one route is displayed --> all routes need to be inside
            Navbar is shown all the time, therefore outside the Switch*/}
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
